    test: /\.(js|jsx)$/,
    loader: 'babel-loader',
    exclude: /node_modules/,
};

export const images = {
    test: /\.(gif|ico|jpe?g|png|svg|webp)$/,
    type: 'asset/resource',
    generator: {
      filename: 'assets/images/[contenthash][ext]',
    },
};

export const css = {
    test: /\.css$/,
    use: [
        config.IS_DEV ? 'style-loader' : MiniCssExtractPlugin.loader,
        'css-loader',
        'postcss-loader',
    ],
    exclude: /node_modules/,
}

